import React, { Component } from 'react';
import Card from './card';
import Navbar from './navbar';
import Searchbar from './searchbar';
import Optionbar from './select';
import Sortbar from './sortbar';
import Rangebar from './range';

export default class App extends Component {

    render() {
        return (
        <div> 
            <Navbar/>
            <div className='container-fluid'>
                <div className='row mt-5'>
                    <div className='col-2 border-right ml-5 mr-5'>
                        <Searchbar/>
                        <Optionbar/>
                        <Rangebar/>
                    </div>
                    <div className='col-8'>
                        <Sortbar/>
                        <div className='row mt-5'>
                            <div className='col'><Card pic='static/images/redmi8.jpg' title='Redmi Note 9 Pro' price='&#x20B9; 15000'/></div>
                            <div className='col'><Card/></div>
                            <div className='col'><Card/></div>
                            <div className='col'><Card/></div>
                            <div className='col'><Card pic='https://images.ctfassets.net/wcfotm6rrl7u/1P6zIW3DURULcnGTh7xEPS/4930666632731970b1828349612aa4cc/nokia_9_pureview-specs_popup-desktop.png' title='Nokia 9 PureView' price='&#x20B9; 49,999'/></div>
                        </div>
                        <div className='row mt-5'>
                            <div className='col'><Card pic='https://images.indianexpress.com/2019/11/Moto-Razr-2019-FB-1.jpg' /></div>
                            <div className='col'><Card/></div>
                            <div className='col'><Card/></div>
                            <div className='col'><Card/></div>
                            <div className='col'><Card/></div>
                        </div>
                    </div>
                </div>
            </div>
        </div>);
        };
}
